    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Trip index{% endblock %}

{% block body %}
    <h1>Trip index</h1>
    <a class=\"btn btn-info\" href=\"{{ path('app_admin_trip_new') }}\">Create new</a>
    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Destination</th>
                <th>Created_at</th>
                <th>Description</th>
                <th>Duree</th>
                <th>Image</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for trip in trips %}
            <tr>
                <td>{{ trip.id }}</td>
                <td>{{ trip.destination }}</td>
                <td>{{ trip.created_at ? trip.created_at|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ trip.description }}</td>
                <td>{{ trip.duree }}</td>
                <td><img src=\"{{trip.image}}\" class=\"card-img-top\" alt=\"img\"></td>
                <td>
                    <a class=\"btn btn-primary\" href=\"{{ path('app_admin_trip_show', {'id': trip.id}) }}\">show</a>
                    <a class=\"btn btn-warning\" <a href=\"{{ path('app_admin_trip_edit', {'id': trip.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"7\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
{% endblock %}
", "admin_trip/index.html.twig", "D:\\Corentin\\trip\\templates\\admin_trip\\index.html.twig");
